query PromoPanelQuery($categoryId: Int!, $target: String!, $path: String!) {
  promoPanel(category_id: $categoryId, target: $target, path: $path) {
    isAvailable
    url
    __typename
  }
}

query BesidaDataQuery {
  context {
    currentUser {
      id
      evo_id
      has_verified_phone
      company_id
      __typename
    }
    besidaUrl
    socialLinks
    __typename
  }
}

query PortableSearchFiltersQuery($search_term: String!, $wholesale: Boolean!, $discount: Boolean!, $delivery_type: String, $related_to_product_id: Int, $show: String, $params: Any, $company_id: Int, $sort: String, $attrsSize: Int) {
  listing: searchListing(search_term: $search_term, wholesale: $wholesale, discount: $discount, delivery_type: $delivery_type, related_to_product_id: $related_to_product_id, show: $show, params: $params, company_id: $company_id, sort: $sort) {
    filters(attrs_size: $attrsSize) {
      ...FiltersFragment
      __typename
    }
    __typename
  }
}

